Insert into T_MAE_TERMINOS (ID_TERMINOS,ID_ROL,CONDICIONES_TERMINOS) values ('1','1','El Proyecto Acciones Nacionales Apropiadas de Mitigacin de energa (NAMA por sus siglas en ingls) en los sectores de generacin de energa y su uso final en el Per promueve acciones de sostenibilidad para alcanzar reducciones en emisiones de gases de efecto invernadero (GEI) como parte de los compromisos internacionales asumido por Per dentro del marco de la Convencin de las Naciones Unidas sobre Cambio Climtico (CMNUCC o UNFCCC por sus siglas en ingls). 
